package NeetCode150.NeetCode75;

import java.util.Arrays;
import java.util.HashMap;
import java.util.Map;

/**
 *
 * @author ssingh Example 1:
 *
 *         Input: s = "anagram", t = "nagaram" Output: true Example 2:
 *
 *         Input: s = "rat", t = "car" Output: false
 */
public class ValidAnagram {

    public static String sortString(String s) {
        char[] toCharArray = s.toCharArray();
        Arrays.sort(toCharArray);
        return new String(toCharArray);
    }

    public static boolean isAnagramSorted(String s, String t) {
        s = sortString(s);
        t = sortString(t);
        if (s.equals(t)) {
            return true;
        }
        return false;
    }

    public static boolean isAnagram(String s, String t) {
        HashMap<Character, Integer> hashMap1 = new HashMap<>();
        HashMap<Character, Integer> hashMap2 = new HashMap<>();
        for (int i = 0; i < s.length(); i++) {

            hashMap1.put(s.charAt(i), hashMap1.getOrDefault(s.charAt(i), 0) + 1);

        }
        for (int i = 0; i < t.length(); i++) {
            if (hashMap2.containsKey(t.charAt(i))) {
                hashMap2.put(t.charAt(i), hashMap2.get(t.charAt(i)) + 1);
            } else {
                hashMap2.put(t.charAt(i), 1);
            }
        }
        // System.out.println(hashMap1.equals(hashMap2));
        for (Map.Entry<Character, Integer> map : hashMap1.entrySet()) {
            if (!hashMap2.containsKey(map.getKey()) && !(hashMap2.get(map.getKey()) == map.getValue())) {
                return false;
            }
        }
        for (Map.Entry<Character, Integer> map : hashMap2.entrySet()) {
            if (!hashMap1.containsKey(map.getKey()) || ((int) hashMap1.get(map.getKey()) != (int) map.getValue())) {
                return false;
            }
        }
        return true;
    }

    public static void main(String[] args) {

        String s = "";
        String t = "";
        long start = System.nanoTime();
        boolean result = isAnagram(s, t);
        long end = System.nanoTime();
        System.out.println((end-start)/ 1_000_000.0);
    }

}
